// src/pages/HomePage.js
import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center p-4">
      <div className="bg-white p-8 rounded shadow-md w-full max-w-lg text-center">
        <h1 className="text-4xl font-bold mb-6">Welcome to Our Application</h1>
        <p className="mb-8">This is the homepage where you can navigate to different sections of the app.</p>
        
        <nav>
          <ul className="space-y-4">
            <li>
              <Link to="/register" className="text-blue-500 hover:text-blue-700">Register</Link>
            </li>
            <li>
              <Link to="/login" className="text-blue-500 hover:text-blue-700">Login</Link>
            </li>
            <li>
              <Link to="/posts" className="text-blue-500 hover:text-blue-700">Posts</Link>
            </li>
            <li>
              <Link to="/gallery" className="text-blue-500 hover:text-blue-700">Gallery</Link>
            </li>
            <li>
              <Link to="/admin" className="text-blue-500 hover:text-blue-700">Admin</Link>
            </li>
          </ul>
        </nav>
      </div>
    </div>
  );
};

export default HomePage;
